import React from 'react'
import Button from '@restart/ui/esm/Button'
import { useHistory } from 'react-router-dom';
import Fotoperfil from './Imagespor/Fotoperfil';


const Portafolio = () => {

    let history = useHistory();
    
    
    return (
        <div>
            <h1>PORTAFOLIO</h1>
            <Button onClick={() => history.push('/home') }>dale click para volver  ala pagina </Button>

            <div>
               <img src="https://www.sena.edu.co/es-co/Noticias/Galeria_SENA_IMG/El%20Centro%20de%20Dise%C3%B1o%20y%20Metrolog%C3%ADa%20celebra%20sus%2030%20a%C3%B1os/Foto1.jpeg"/>
               
            </div>
            <img src={ Fotoperfil} />
        </div>
    )
}

export default Portafolio
